import React from 'react'

function Nav() {
  return (
    <div id='NAV'>
        <div  className="fpp1"><img src={require("./pp.jpg")} alt=""/><span>Niccol√≤</span></div>
        <div  className="fpp1"><i class="fa-solid fa-user-group fa-customize"></i><span>Find friends</span></div>
        <div  className="fpp1"><i class="fa-solid fa-bookmark fa-customize"></i><span>Saved</span></div>
        <div  className="fpp1"><i class="fa-solid fa-users fa-customize"></i><span>Saved</span></div>
        <div  className="fpp1"><i class="fa-solid fa-tv fa-customize"></i><span>Saved</span></div>

    </div>
  )
}

export default Nav
